import '../style/Header.scss'

function Header({classname,content}:{classname:string,content:string}){
  return (
    <div className={classname}>
      <h1>this is a header</h1>
      <hr></hr>
      <h3>{content}</h3>
    </div>
  )
}
export default Header;
